module.exports = "<section id=\"ng-buttons\">\n    <div class=\"row text-left\">\n        <div class=\"col-sm-12 mt-2\">\n            <div class=\"content-header\">Ngb-Buttons</div>\n            <p class=\"content-sub-header\">Easily create Bootstrap-style checkbox buttons. A value of a checked button is bound to a variable specified\n                via <code>ngModel</code>.</p>\n        </div>\n    </div>\n    <div class=\"row text-left\" matchHeight =\"card\">\n        <!--Checkbox ng-buttons Starts-->\n        <div class=\"col-md-12 col-lg-6\">\n            <div class=\"card\">\n                <div class=\"card-header\">\n                    <h4 class=\"card-title\">Checkbox buttons</h4>\n                    <p>Easily create Bootstrap-style checkbox buttons.</p>\n                </div>\n                <div class=\"card-content\">\n                    <div class=\"card-body\">\n                        <div class=\"btn-group btn-group-toggle\">\n                            <label class=\"btn-raised btn-primary\" ngbButtonLabel>\n                                <input type=\"checkbox\" ngbButton [(ngModel)]=\"model.left\"> Left (pre-checked)\n                            </label>\n                            <label class=\"btn-raised btn-primary\" ngbButtonLabel>\n                                <input type=\"checkbox\" ngbButton [(ngModel)]=\"model.middle\"> Middle\n                            </label>\n                            <label class=\"btn-raised btn-primary\" ngbButtonLabel>\n                                <input type=\"checkbox\" ngbButton [(ngModel)]=\"model.right\"> Role\n                            </label>\n                        </div>\n                        <hr>\n                        <p>{{model | json}}</p>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <!--Checkbox ng-buttons Ends-->\n\n        <!--Checkbox Reactive buttons Starts-->\n        <div class=\"col-md-12 col-lg-6\">\n            <div class=\"card\">\n                <div class=\"card-header\">\n                    <h4 class=\"card-title\">Checkbox buttons (Reactive Forms)</h4>\n                    <p>A value of a checked button is bound to a variable specified via ngModel.</p>\n                </div>\n                <div class=\"card-content\">\n                    <div class=\"card-body\">\n                        <form [formGroup]=\"checkboxGroupForm\">\n                            <div class=\"btn-group btn-group-toggle\">\n                                <label class=\"btn-raised btn-primary\" ngbButtonLabel>\n                                    <input type=\"checkbox\" formControlName=\"left\" ngbButton> Left (pre-checked)\n                                </label>\n                                <label class=\"btn-raised btn-primary\" ngbButtonLabel>\n                                    <input type=\"checkbox\" formControlName=\"middle\" ngbButton> Middle\n                                </label>\n                                <label class=\"btn-raised btn-primary\" ngbButtonLabel>\n                                    <input type=\"checkbox\" formControlName=\"right\" ngbButton> Role\n                                </label>\n                            </div>\n                        </form>\n                        <hr>\n                        <p>{{checkboxGroupForm.value | json}}</p>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <!--Checkbox Reactive buttons Ends-->\n    </div>\n    <div class=\"row text-left\" matchHeight =\"card\">\n        <!--Radio buttons Starts-->\n        <div class=\"col-md-12 col-lg-6\">\n            <div class=\"card\">\n                <div class=\"card-header\">\n                    <h4 class=\"card-title\">Radio buttons</h4>\n                </div>\n                <div class=\"card-content\">\n                    <div class=\"card-body\">\n                        <div class=\"btn-group btn-group-toggle\" ngbRadioGroup name=\"radioBasic\" [(ngModel)]=\"modelRadio\">\n                            <label ngbButtonLabel class=\"btn-raised btn-primary\">\n                                <input ngbButton type=\"radio\" [value]=\"1\"> Left (pre-checked)\n                            </label>\n                            <label ngbButtonLabel class=\"btn-raised btn-primary\">\n                                <input ngbButton type=\"radio\" value=\"2\"> Middle\n                            </label>\n                            <label ngbButtonLabel class=\"btn-raised btn-primary\">\n                                <input ngbButton type=\"radio\" [value]=\"3\"> Role\n                            </label>\n                        </div>\n                        <hr>\n                        <p>{{modelRadio}}</p>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <!--Radio buttons Ends-->\n\n        <!--Radio Reactive buttons Starts-->\n        <div class=\"col-md-12 col-lg-6\">\n            <div class=\"card\">\n                <div class=\"card-header\">\n                    <h4 class=\"card-title\">Radio buttons (Reactive Forms)</h4>\n                    <p>A value of a checked button is bound to a variable specified via ngModel.</p>\n                </div>\n                <div class=\"card-content\">\n                    <div class=\"card-body\">\n                        <form [formGroup]=\"radioGroupForm\">\n                            <div class=\"btn-group btn-group-toggle\" ngbRadioGroup name=\"radioBasic\" formControlName=\"modelRadioForm\">\n                                <label ngbButtonLabel class=\"btn-raised btn-primary\">\n                                <input ngbButton type=\"radio\" value=\"Left\"> Left (pre-checked)\n                                </label>\n                                <label ngbButtonLabel class=\"btn-raised btn-primary\">\n                                <input ngbButton type=\"radio\" value=\"Middle\"> Middle\n                                </label>\n                                <label ngbButtonLabel class=\"btn-raised btn-primary\">\n                                <input ngbButton type=\"radio\" value=\"Role\"> Role\n                                </label>\n                            </div>\n                        </form>\n                        <hr>\n                        <p>{{radioGroupForm.value['modelRadioForm']}}</p>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <!--Radio Reactive buttons Ends-->\n    </div>\n</section>"

