module.exports = "<!--Basic Pagination Starts-->\n<section id=\"basic-pagination\">\n    <div class=\"row text-left\">\n        <div class=\"col-sm-12\">\n            <div class=\"content-header\">Pagination</div>\n            <p class=\"content-sub-header\">Provide pagination links for your site or app with the multi-page pagination component, or the simpler pager alternative.</p>\n        </div>\n    </div>\n    <div class=\"row text-left\" matchHeight =\"card\">\n        <!--Basic Pagination Starts-->\n        <div class=\"col-xl-6 col-lg-12\">\n            <div class=\"card\">\n                <div class=\"card-header\">\n                    <h4 class=\"card-title\">Basic Pagination</h4>\n                </div>\n                <div class=\"card-content\">\n                    <div class=\"card-body\">\n                        <h5 class=\"mb-2 mt-4 text-bold-400\">Default pagination</h5>\n                        <ngb-pagination [collectionSize]=\"70\" [(page)]=\"page\"></ngb-pagination>\n                        <h5 class=\"mb-2 mt-4 text-bold-400\">directionLinks = false</h5>\n                        <ngb-pagination [collectionSize]=\"70\" [(page)]=\"page1\" [directionLinks]=\"false\"></ngb-pagination>\n                        <h5 class=\"mb-2 mt-4 text-bold-400\">boundaryLinks = true</h5>\n                        <ngb-pagination [collectionSize]=\"70\" [(page)]=\"page2\" [boundaryLinks]=\"true\"></ngb-pagination>\n                        <hr>\n                        <p>Current page: {{page2}}</p>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <!--Basic Pagination Ends-->\n\n        <!--Advanced Pagination Starts-->\n        <div class=\"col-xl-6 col-lg-12\">\n            <div class=\"card\">\n                <div class=\"card-header\">\n                    <h4 class=\"card-title\">Advanced Pagination</h4>\n                </div>\n                <div class=\"card-content\">\n                    <div class=\"card-body\">\n                        <h5 class=\"mb-2 mt-4 text-bold-400\">maxSize = 5, rotate = false</h5>\n                        <ngb-pagination [collectionSize]=\"120\" [(page)]=\"page3\" [maxSize]=\"5\" [boundaryLinks]=\"true\"></ngb-pagination>\n                        <h5 class=\"mb-2 mt-4 text-bold-400\">maxSize = 5, rotate = true</h5>\n                        <ngb-pagination [collectionSize]=\"120\" [(page)]=\"page4\" [maxSize]=\"5\" [rotate]=\"true\" [boundaryLinks]=\"true\"></ngb-pagination>\n                        <h5 class=\"mb-2 mt-4 text-bold-400\">maxSize = 5, rotate = true, ellipses = false</h5>\n                        <ngb-pagination [collectionSize]=\"120\" [(page)]=\"page5\" [maxSize]=\"5\" [rotate]=\"true\" [ellipses]=\"false\" [boundaryLinks]=\"true\"></ngb-pagination>\n                        <hr>\n                        <p>Current page: {{page5}}</p>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <!--Advanced Pagination Ends-->\n    </div>\n</section>\n<section id=\"pagination-option\">\n    <div class=\"row text-left\" matchHeight =\"card\">\n        <!--Pagination Sizes Starts-->\n        <div class=\"col-xl-6 col-lg-12\">\n            <div class=\"card\">\n                <div class=\"card-header\">\n                    <h4 class=\"card-title\">Pagination Sizes</h4>\n                </div>\n                <div class=\"card-content\">\n                    <div class=\"card-body\">\n                        <h5 class=\"mb-2 mt-4 text-bold-400\">Large Pagination</h5>\n                        <ngb-pagination [collectionSize]=\"30\" [(page)]=\"currentPage\" size=\"lg\"></ngb-pagination>\n                        <h5 class=\"mb-2 mt-4 text-bold-400\">Default Pagination</h5>\n                        <ngb-pagination [collectionSize]=\"30\" [(page)]=\"currentPage1\"></ngb-pagination>\n                        <h5 class=\"mb-2 mt-4 text-bold-400\">Small Pagination</h5>\n                        <ngb-pagination [collectionSize]=\"30\" [(page)]=\"currentPage2\" size=\"sm\"></ngb-pagination>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <!--Pagination Sizes Ends-->\n\n        <!--Pagination Options Starts-->\n        <div class=\"col-xl-6 col-lg-12\">\n            <div class=\"card\">\n                <div class=\"card-header\">\n                    <h4 class=\"card-title\">Pagination Options</h4>\n                </div>\n                <div class=\"card-content\">\n                    <div class=\"card-body\">\n                        <h5 class=\"mb-2 mt-4 text-bold-400\">Pagination control can be disabled</h5>\n                        <ngb-pagination [collectionSize]=\"70\" [(page)]=\"page6\" [disabled]='isDisabled'></ngb-pagination>\n                        <button class=\"btn btn-sm btn-outline-primary\" (click)=\"toggleDisabled()\">\n                            Toggle disabled\n                        </button>\n                        \n                        <h5 class=\"mb-2 mt-4 text-bold-400\">This pagination uses custom default values</h5>\n                        <ngb-pagination [collectionSize]=\"70\" [(page)]=\"page7\"></ngb-pagination>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <!--Pagination Options Ends-->\n    </div>\n</section>\n<!--Basic Pagination Ends-->"

