module.exports = "<!-- Progress Bar Starts-->\n<section id=\"basic-progress\">\n    <div class=\"row text-left\">\n        <div class=\"col-sm-12\">\n            <div class=\"content-header\">Progress Bars</div>\n        </div>\n    </div>\n    <div class=\"row text-left\">\n        <!--Contextual progress bars Starts-->\n        <div class=\"col-12\">\n            <div class=\"card\">\n                <div class=\"card-header\">\n                    <h4 class=\"card-title\">Contextual progress bars</h4>\n                    <p>Stylize the HTML5 <code>progress</code> element with a few extra classes and some crafty browser-specific\n                        CSS. Be sure to read up on the browser support.</p>\n                </div>\n                <div class=\"card-content\">\n                    <div class=\"card-body\">\n                        <p>\n                            <ngb-progressbar type=\"success\" [value]=\"25\"></ngb-progressbar>\n                        </p>\n                        <p>\n                            <ngb-progressbar type=\"info\" [value]=\"50\"></ngb-progressbar>\n                        </p>\n                        <p>\n                            <ngb-progressbar type=\"warning\" [value]=\"75\"></ngb-progressbar>\n                        </p>\n                        <p>\n                            <ngb-progressbar type=\"danger\" [value]=\"100\"></ngb-progressbar>\n                        </p>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <!--Contextual progress bars Ends-->\n    </div>\n    <div class=\"row text-left\">\n        <!--Progress bars with current value labels Starts-->\n        <div class=\"col-12\">\n            <div class=\"card\">\n                <div class=\"card-header\">\n                    <h4 class=\"card-title\">Progress bars with current value labels</h4>\n                    <p>Add labels to your progress bars by placing text within the <code class=\"highlighter-rouge\">.progress-bar</code>.</p>\n                </div>\n                <div class=\"card-content\">\n                    <div class=\"card-body\">\n                        <p>\n                            <ngb-progressbar showValue=\"true\" type=\"success\" [value]=\"25\"></ngb-progressbar>\n                        </p>\n                        <p>\n                            <ngb-progressbar [showValue]=\"true\" type=\"info\" [value]=\"50\"></ngb-progressbar>\n                        </p>\n                        <p>\n                            <ngb-progressbar showValue=\"true\" type=\"warning\" [value]=\"150\" [max]=\"200\"></ngb-progressbar>\n                        </p>\n                        <p>\n                            <ngb-progressbar [showValue]=\"true\" type=\"danger\" [value]=\"150\" [max]=\"150\"></ngb-progressbar>\n                        </p>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <!--Progress bars with current value labels Ends-->\n    </div>\n    <div class=\"row text-left\">\n        <!--Striped progress bars Starts-->\n        <div class=\"col-12\">\n            <div class=\"card\">\n                <div class=\"card-header\">\n                    <h4 class=\"card-title\">Striped progress bars</h4>\n                    <p>Uses a gradient to create a striped effect.</p>\n                </div>\n                <div class=\"card-content\">\n                    <div class=\"card-body\">\n                        <p>\n                            <ngb-progressbar type=\"success\" [value]=\"25\" [striped]=\"true\"></ngb-progressbar>\n                        </p>\n                        <p>\n                            <ngb-progressbar type=\"info\" [value]=\"50\" [striped]=\"true\"></ngb-progressbar>\n                        </p>\n                        <p>\n                            <ngb-progressbar type=\"warning\" [value]=\"75\" [striped]=\"true\"></ngb-progressbar>\n                        </p>\n                        <p>\n                            <ngb-progressbar type=\"danger\" [value]=\"100\" [striped]=\"true\"></ngb-progressbar>\n                        </p>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <!--Striped progress bars Ends-->\n    </div>\n    <div class=\"row text-left\">\n        <!--Progress bars with custom labels Starts-->\n        <div class=\"col-12\">\n            <div class=\"card\">\n                <div class=\"card-header\">\n                    <h4 class=\"card-title\">Progress bars with custom labels</h4>\n                    <p></p>\n                </div>\n                <div class=\"card-content\">\n                    <div class=\"card-body\">\n                        <p>\n                            <ngb-progressbar type=\"success\" [value]=\"25\">25</ngb-progressbar>\n                        </p>\n                        <p>\n                            <ngb-progressbar type=\"info\" [value]=\"50\">Copying file <b>2 of 4</b>...</ngb-progressbar>\n                        </p>\n                        <p>\n                            <ngb-progressbar type=\"warning\" [value]=\"75\" [striped]=\"true\" [animated]=\"true\"><i>50%</i></ngb-progressbar>\n                        </p>\n                        <p>\n                            <ngb-progressbar type=\"danger\" [value]=\"100\" [striped]=\"true\">Completed!</ngb-progressbar>\n                        </p>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <!--Progress bars with custom labels Ends-->\n    </div>\n    <div class=\"row text-left\">\n        <!--Progress bars Sizes Starts-->\n        <div class=\"col-12\">\n            <div class=\"card\">\n                <div class=\"card-header\">\n                    <h4 class=\"card-title\">Progress bars Sizes</h4>\n                    <p></p>\n                </div>\n                <div class=\"card-content\">\n                    <div class=\"card-body\">\n                        <h5 class=\"mb-4\">Default Progress Bar <small>No extra class needed.</small></h5>\n                        <p>\n                            <ngb-progressbar type=\"info\" [value]=\"30\"></ngb-progressbar>\n                        </p>\n                        <h5 class=\"mb-4\">Medium Progress Bar <small>Use <code>.progress-bar-md</code> class</small></h5>\n                        <p>\n                            <ngb-progressbar type=\"warning\" [value]=\"50\" [striped]=\"true\" class=\"progress-bar-md\"></ngb-progressbar>\n                        </p>\n                        <h5 class=\"mb-4\">Small Progress Bar <small> Use <code>.progress-bar-sm</code> class</small></h5>\n                        <p>\n                            <ngb-progressbar type=\"danger\" [value]=\"75\" [striped]=\"true\" [animated]=\"true\" class=\"progress-bar-sm\"></ngb-progressbar>\n                        </p>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <!--Progress bars Sizes Ends-->\n    </div>\n    <div class=\"row text-left\">\n        <!--Global configuration of progress bars Starts-->\n        <div class=\"col-12\">\n            <div class=\"card\">\n                <div class=\"card-header\">\n                    <h4 class=\"card-title\">Global configuration of progress bars</h4>\n                    <p></p>\n                </div>\n                <div class=\"card-content\">\n                    <div class=\"card-body\">\n                        <p>\n                            <ngb-progressbar type=\"primary\" [value]=\"20\"  [striped]=\"true\" [animated]=\"true\"></ngb-progressbar>\n                        </p>\n                        <p>\n                            <ngb-progressbar type=\"success\" [value]=\"40\"  [striped]=\"true\" [animated]=\"true\"></ngb-progressbar>\n                        </p>\n                        <p>\n                            <ngb-progressbar type=\"info\" [value]=\"60\"  [striped]=\"true\" [animated]=\"true\"></ngb-progressbar>\n                        </p>\n                        <p>\n                            <ngb-progressbar type=\"warning\" [value]=\"75\" [striped]=\"true\" [animated]=\"true\"></ngb-progressbar>\n                        </p>\n                        <p>\n                            <ngb-progressbar type=\"danger\" [value]=\"90\" [striped]=\"true\" [animated]=\"true\"></ngb-progressbar>\n                        </p>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <!--Global configuration of progress bars Ends-->\n    </div>\n</section>\n<!-- Progress Bar Ends-->"

