module.exports = "<!--Rating Starts-->\n<section id=\"rating\">\n  <div class=\"row text-left\">\n    <div class=\"col-sm-12\">\n      <div class=\"content-header\">Rating</div>\n    </div>\n  </div>\n  <div class=\"row text-left\" matchHeight=\"card\">\n    <!--Basic Rating Starts-->\n    <div class=\"col-md-12 col-lg-6\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <h4 class=\"card-title\">Basic Rating</h4>\n          <p>Rating directive that will take care of visualising a star rating bar.</p>\n        </div>\n        <div class=\"card-content\">\n          <div class=\"card-body\">\n            <ngb-rating [(rate)]=\"currentRate\"></ngb-rating>\n            <p>Rate: <b>{{currentRate}}</b></p>\n          </div>\n        </div>\n      </div>\n    </div>\n    <!--Basic Rating Ends-->\n\n    <!--Custom star template Starts-->\n    <div class=\"col-md-12 col-lg-6\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <h4 class=\"card-title\">Custom star template</h4>\n          <p>Custom rating template provided as child element</p>\n        </div>\n        <div class=\"card-content\">\n          <div class=\"card-body\">\n            <ngb-rating [(rate)]=\"currentRating\">\n              <ng-template let-fill=\"fill\">\n                <span class=\"star\" [class.filled]=\"fill === 100\">&#9733;</span>\n              </ng-template>\n            </ngb-rating>\n            <p>Rate: <b>{{currentRating}}</b></p>\n          </div>\n        </div>\n      </div>\n    </div>\n    <!--Custom star template Ends-->\n  </div>\n  <div class=\"row text-left\" matchHeight=\"card\">\n    <!--Events and readonly ratings Starts-->\n    <div class=\"col-md-12 col-lg-6\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <h4 class=\"card-title\">Events and readonly ratings</h4>\n          <p>Readonly and editable rating events.</p>\n        </div>\n        <div class=\"card-content\">\n          <div class=\"card-body\">\n            <ngb-rating [(rate)]=\"selected\" (hover)=\"hovered=$event\" (leave)=\"hovered=0\" [readonly]=\"readonly\"></ngb-rating>\n            <p>Selected: <b>{{selected}}</b> Hovered: <b>{{hovered}}</b>\n            </p>\n            <button class=\"btn btn-sm btn-outline-{{readonly ? 'danger' : 'success'}}\" (click)=\"readonly = !readonly\">\n              {{ readonly ? \"readonly\" : \"editable\"}}\n            </button>\n          </div>\n        </div>\n      </div>\n    </div>\n    <!--Events and readonly ratings Ends-->\n\n    <!--Form integration Starts-->\n    <div class=\"col-md-12 col-lg-6\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <h4 class=\"card-title\">Form integration</h4>\n          <p>NgModel and reactive forms can be used without the 'rate' binding</p>\n        </div>\n        <div class=\"card-content\">\n          <div class=\"card-body\">\n\n            <div class=\"form-group\" [class.has-success]=\"ctrl.valid\" [class.has-danger]=\"ctrl.invalid\">\n              <ngb-rating [formControl]=\"ctrl\"></ngb-rating>\n              <div class=\"form-control-feedback\">\n                <div *ngIf=\"ctrl.valid\">Thanks!</div>\n                <div *ngIf=\"ctrl.errors\">Please rate us</div>\n              </div>\n            </div>\n\n            <p>Model: <b>{{ ctrl.value }}</b></p>\n            <button class=\"btn btn-sm btn-outline-{{ ctrl.disabled ? 'danger' : 'success'}} mr-1\" (click)=\"toggle()\">\n              {{ ctrl.disabled ? \"control disabled\" : \" control enabled\" }}\n            </button>\n            <button class=\"btn btn-sm btn-outline-primary\" (click)=\"ctrl.setValue(null)\">Clear</button>\n          </div>\n        </div>\n      </div>\n    </div>\n    <!--Form integration Ends-->\n  </div>\n  <div class=\"row text-left\" matchHeight=\"card\">\n    <!--Custom decimal rating Starts-->\n    <div class=\"col-md-12 col-lg-6\">\n      <div class=\"card\">\n        <div class=\"card-header\">\n          <h4 class=\"card-title\">Custom decimal rating</h4>\n          <p>Custom rating template provided via a variable. Shows fine-grained rating display</p>\n        </div>\n        <div class=\"card-content\">\n          <div class=\"card-body\">\n            <ng-template #t let-fill=\"fill\">\n              <span *ngIf=\"fill === 100\" class=\"star full\">&hearts;</span>\n              <span *ngIf=\"fill === 0\" class=\"star\">&hearts;</span>\n              <span *ngIf=\"fill < 100 && fill > 0\" class=\"star\">\n                <span class=\"half\" [style.width.%]=\"fill\">&hearts;</span>&hearts;\n              </span>\n            </ng-template>\n\n            <ngb-rating [(rate)]=\"decimalCurrentRate\" [starTemplate]=\"t\" [readonly]=\"true\" max=\"5\"></ngb-rating>\n            <p>Rate: <b>{{decimalCurrentRate}}</b></p>\n            <button class=\"btn btn-sm btn-outline-primary mr-1\" (click)=\"decimalCurrentRate = 1.35\">1.35</button>\n            <button class=\"btn btn-sm btn-outline-primary\" (click)=\"decimalCurrentRate = 4.72\">4.72</button>\n          </div>\n        </div>\n      </div>\n    </div>\n    <!--Custom decimal rating Ends-->\n  </div>\n</section>\n<!--Rating Ends-->\n"

