module.exports = "<!-- // Basic example section Starts -->\n<section id=\"basic-examples\">\n    <div class=\"row text-left\">\n        <div class=\"col-sm-12 mt-3 mb-1\">\n            <div class=\"content-header\">SweetAlert</div>\n            <p class=\"content-sub-header\">SweetAlert automatically centers itself on the page and looks great no matter if you're using a desktop computer, mobile or tablet. It's even highly customizable, as you can see below!</p>\n        </div>\n    </div>\n    <div class=\"card text-left\">\n        <div class=\"card-content\">\n            <div class=\"card-body\">\n                <div class=\"row mt-1\">\n                    <div class=\"col-md-4 col-sm-6 col-12\">\n                        <button type=\"button\" class=\"btn btn-primary btn-raised btn-block\" id=\"basic-alert\" (click)=\"basicAlert()\">Basic</button>\n                    </div>\n                    <div class=\"col-md-4 col-sm-6 col-12\">\n                        <button type=\"button\" class=\"btn btn-primary btn-raised btn-block\" id=\"with-title\" (click)=\"withTitle()\">With Title</button>\n                    </div>\n                    <div class=\"col-md-4 col-sm-12\">\n                        <button type=\"button\" class=\"btn btn-primary btn-raised btn-block\" id=\"html-alert\" (click)=\"htmlAlert()\">HTML</button>\n                    </div>\n                </div>\n            </div>\n        </div>\n    </div>\n</section>\n<!-- // Basic example section end -->\n\n<!-- Types section start -->\n<section id=\"types\">\n    <div class=\"row text-left\">\n        <div class=\"col-12 mt-3 mb-1\">\n            <div class=\"content-header\">Types</div>\n            <p class=\"content-sub-header\">The type of the modal. SweetAlert comes with 5 built-in types which will show a corresponding icon animation: \"warning\", \"error\", \"success\" \"info\" and \"question\". You can also set it as \"input\" to get a prompt modal. It can either be put in the object under the key \"type\" or passed as the third parameter of the function.</p>\n        </div>\n    </div>\n    <div class=\"card text-left\">\n        <div class=\"card-content\">\n            <div class=\"card-body\">\n                <div class=\"row mt-1\">\n                    <div class=\"col-md-4 col-sm-6 col-12\">\n                        <button type=\"button\" class=\"btn btn-secondary btn-raised btn-block mb-5\" id=\"type-question\" (click)=\"typeQuestion()\">Question</button>\n                    </div>\n                    <div class=\"col-md-4 col-sm-6 col-12\">\n                        <button type=\"button\" class=\"btn btn-success btn-raised btn-block mb-5\" id=\"type-success\" (click)=\"typeSuccess()\">Success</button>\n                    </div>\n                    <div class=\"col-md-4 col-sm-6 col-12\">\n                        <button type=\"button\" class=\"btn btn-info btn-raised btn-block mb-5\" id=\"type-info\" (click)=\"typeInfo()\">Info</button>\n                    </div>\n                    <div class=\"col-sm-6 col-12\">\n                        <button type=\"button\" class=\"btn btn-warning btn-raised btn-block mb-5\" id=\"type-warning\" (click)=\"typeWarning()\">Warning</button>\n                    </div>\n                    <div class=\"col-sm-6 col-12\">\n                        <button type=\"button\" class=\"btn btn-danger btn-raised btn-block mb-5\" id=\"type-error\" (click)=\"typeError()\">Error</button>\n                    </div>\n                </div>\n            </div>\n        </div>\n    </div>\n</section>\n<!-- // Types section end -->\n\n\n<!-- Options section start -->\n<section id=\"options\">\n    <div class=\"row text-left\">\n        <div class=\"col-12 mt-3 mb-1\">\n            <div class=\"content-header\">Options</div>\n        </div>\n    </div>\n    <div class=\"card text-left\">\n        <div class=\"card-content\">\n            <div class=\"card-body\">\n                <div class=\"row mt-1\">\n                    <div class=\"col-lg-4 col-sm-6 col-12\">\n                        <h5 class=\"mt-4\">Custom Icon</h5>\n                        <p><code>imageUrl</code> is used to add a customized icon for the modal. Should contain a string with the path to the image.</p>\n                        <button type=\"button\" class=\"btn btn-primary btn-raised btn-block\" id=\"custom-icon\" (click)=\"customIcon()\">Custom Icon</button>\n                    </div>\n                    <div class=\"col-lg-4 col-sm-6 col-12\">\n                        <h5 class=\"mt-4\">Auto Close Timer</h5>\n                        <p>A message with auto close timer. <code>timer</code> is default set to <code>null</code>. You can set timer in ms (milliseconds).</p>\n                        <button type=\"button\" class=\"btn btn-primary btn-raised btn-block\" id=\"auto-close\" (click)=\"autoClose()\">Auto Close</button>\n                    </div>\n                    <div class=\"col-lg-4 col-sm-6 col-12\">\n                        <h5 class=\"mt-4\">Allow Outside Click</h5>\n                        <p>If <code>allowOutsideClick</code> is set to <code>true</code>, the user can dismiss the modal by clicking outside it.</p>\n                        <button type=\"button\" class=\"btn btn-primary btn-raised btn-block\" id=\"outside-click\" (click)=\"outsideClick()\">Click Outside</button>\n                    </div>\n                    <div class=\"col-lg-4 col-sm-6 col-12\">\n                        <h5 class=\"mt-4\">Ajax Request</h5>\n                        <p>Set <code>showLoaderOnConfirm</code> to true to disable the buttons and show that something is loading. AJAX request for example.</p>\n                        <button type=\"button\" class=\"btn btn-primary btn-raised btn-block\" id=\"ajax-request\" (click)=\"ajaxRequest()\">Ajax</button>\n                    </div>\n                    <div class=\"col-lg-4 col-sm-6 col-12\">\n                        <h5 class=\"mt-4\">Button Options</h5>\n                        <p>Custom HTML description and buttons</p>\n                        <button type=\"button\" class=\"btn btn-primary btn-raised btn-block\" id=\"custom-button\" (click)=\"customButton()\">Custom HTML and buttons</button>\n                    </div>\n                    <div class=\"col-lg-4 col-sm-6 col-12\">\n                        <h5 class=\"mt-4\">Prompt Function</h5>\n                        <p>A replacement for the \"prompt\" function. You can set <code>type</code> as \"input\" to get a prompt modal.</p>\n                        <button type=\"button\" class=\"btn btn-primary btn-raised btn-block\" id=\"prompt-function\" (click)=\"promptFunction()\">Prompt</button>\n                    </div>\n                </div>\n            </div>\n        </div>\n    </div>\n</section>\n<!-- // Options section end -->\n\n<!-- Button Action option section start -->\n<section id=\"action-option\">\n    <div class=\"row text-left\">\n        <div class=\"col-12 mt-3 mb-1\">\n            <div class=\"content-header\">Button Actions</div>\n        </div>\n    </div>\n    <div class=\"card text-left\">\n        <div class=\"card-content\">\n            <div class=\"card-body\">\n                <div class=\"row mt-1\">\n                    <div class=\"col-lg-4 col-sm-6 col-12\">\n                        <h5 class=\"mt-4\">Confirm Button Action</h5>\n                        <p>A warning message, with a function attached to the \"Confirm\"-button.</p>\n                        <button type=\"button\" class=\"btn btn-primary btn-raised btn-block\" id=\"confirm-text\" (click)=\"confirmText()\">Confirm Text</button>\n                    </div>\n                    <div class=\"col-lg-4 col-sm-6 col-12\">\n                        <h5 class=\"mt-4\">Confirm &amp; Cancel Button</h5>\n                        <p>Confirm and cancel button excecution options.</p>\n                        <button type=\"button\" class=\"btn btn-primary btn-raised btn-block\" id=\"confirm-cancel\" (click)=\"confirmCancelButton()\">Buttons Actions</button>\n                    </div>\n                    <div class=\"col-lg-4 col-sm-6 col-12\">\n                        <h5 class=\"mt-4\">Chaining modals</h5>\n                        <p>Changing modal on next button.</p>\n                        <button type=\"button\" class=\"btn btn-primary btn-raised btn-block\" id=\"steps\" (click)=\"steps()\">Steps</button>\n                    </div>\n                </div>\n            </div>\n        </div>\n    </div>\n</section>\n<!-- // Button Confirm option section end -->"

